Fall is almost here and pumpkin season is already taking flight! This autumn appropriate breakfast item is one of many creations courtesy of the pumpkin spice recipe posted on August 31st.

And more good news! If you favor a plant-based diet, this recipe is for you! 😁

Ingredients
2 cups almond flour
½ tsp baking powder
¼ cup maple syrup 
½ cup peanut butter
1 tbsp pumpkin spice blend
½ tsp salt
1 tsp vanilla extract

Instructions
(1) Whisk together almond flour, baking powder, pumpkin spice blend and salt. Add maple syrup, peanut butter and vanilla. Mix until dough forms.
(2) Divide dough in half or into quarters and roll out between pieces of parchment paper until ½-¾ inch thick. Cut out shapes using a cookie cutter or sharp knife.
(3) Bake at 350°F for 10-12 minutes. Allow to cool before enjoying.

Eat well, friends! 😁

